import "./BingoIntroPage.css";

function BingoIntroPage() {
  const myName = "Kat";
  const myMbti = "INFP";
  const mistypesINFP = [ENFP_FI, ISFP, ISFJ];

  return (
    <>
      <h2>
        <span className="accent color">
          {myMbti} {myName}{" "}
        </span>
        님의 <span className="accent highlight color">진짜 MBTI</span>는?!
      </h2>

      <p>
        {myMbti} 맞춤형 미스테리 빙고판이 {mistypesINFP.length}개 준비되어
        있어요!
      </p>
    </>
  );
}

export default BingoIntroPage;
